import { makeStyles } from "@material-ui/styles";

const useStyles = theme => makeStyles({
  root: {
    position: "relative",
    height: "100%"
  },
  tabs: {
    width: "100%",
    bottom: 0
  },
  indicator: {
    height: 50
  }

});

export default useStyles;
